over 5 years ago i did a photo shoot with @adambouska for the #noh8 campaign. my life has been dedicated to not only speaking life giving words but to create life giving spaces by linking arms with others to find ways to change and better our world. â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢ hate continues today as does violence and mistreatment of our fellow human family. well, you and i have a choice. will we simply shake our heads in disgust or will we work to build a world out of love in small and larger ways? â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢ as for me and my family- we choose to work. work to honor **all** of humanity, to honor our **connection** to the human family, & to understand our **responsibilities**. those include working towards understanding our own privilege, dismantling supremacy culture, and to be involved in anti-racist, anti- sexist, anti-oppression work to name a few. we choose to become an accomplice in the work and do our own part to create a better world not only for us but for all.
 #noh8 indeed. @nashvillepridefestival @imaginariumcommunity 
@workplaybuild @faithandculture @activistheology 
